import React from 'react'

import back1 from './back1.png'

const Logout = (e) =>{
  e.preventDefault();

}
const Mainpage = () => {
  return (

    <div>
          <img src = {back1} alt="" style={{

position: 'fixed',
top: 0, 
left: 0,

/* Preserve aspet ratio */
minWidth: '100%',
minHeight: '1005',


          }}/>
      
      LOG IN YoOU
      <button onClick={Logout}>Logout</button>
    </div>
    
  )
}

export default Mainpage
